import React, { Component } from 'react'
import Table from './Table'
import Form from './Form'
import AvgTop30Contacted from './Average30Contacted'

class App extends Component {
    state = {
        characters: [],
        averageListing: {},
        distributions: [],
        top5PerMonth: {},
        averge30TopContacted: ""
    };

    removeCharacter = (index) => {
        const { characters } = this.state

        this.setState({
            characters: characters.filter((character, i) => {
                return i !== index
            }),
        })
    }

    handleSubmit = (character) => {
        this.setState({ characters: [...this.state.characters, character] })
    }

    componentDidMount() {
        fetch('http://localhost:8080/Averge30TopContacted', {headers:{"Access-Control-Allow-Origin":"*", "Access-Control-Allow-Headers":"X-Requested-With"}  })
            .then(res => res.json())
            .then((data) => {
                this.setState({ averge30TopContacted: data })
                console.log(data);
            })
            .catch(console.log)
    }

    render() {
        const { characters } = this.state

        return (
            <div className="container">
                <AvgTop30Contacted avgTop30Contacted={this.state.averge30TopContacted}/>
            </div>
        )
    }
}

